<?php
$green = "data:image/png;base64,";
$red = "data:image/png;base64,";
$yellow = "data:image/png;base64,";

if(!function_exists("get_empyt_color")){
function get_empyt_color($string_empty,$span) {
    global $red, $green;
	switch($string_empty[$span]) {
		case 0:
			return array(
            "<td><img height='15' width='15' src='{$red}'></td>",
            "<td><img height='15' width='15' src='{$red}'></td>");
		case 1:
			return array(
            "<td><img height='15' width='15' src='{$green}'></td>",
            "<td><img height='15' width='15' src='{$red}'></td>");
		case 2:
			return array(
            "<td><img height='15' width='15' src='{$red}'></td>",
            "<td><img height='15' width='15' src='{$green}'></td>");
		case 3:
			return array(
            "<td><img height='15' width='15' src='{$green}'></td>",
            "<td><img height='15' width='15' src='{$green}'></td>");
	}
}}

if(!function_exists("get_color_pic")){
function get_color_pic($color_name) {
	global $red, $green, $yellow;
	switch($color_name) {
		case "red":return "<img class='get_red_pic' height='15' width='15' src='{$red}'>";
		case "green":return "<img height='15' width='15' src='{$green}'>";
		case "yellow":return "<img height='15' width='15' src='{$yellow}'>";
	}
}}
?>